function AdminDashboard(){
    const navigate = useNavigate()
    const [products, setProducts] = useState([])
  
    useEffect(() => {
      loadProducts();
    }, [])
  
    const loadProducts = async () => {
      const response = await getProductList()
      console.log(response)  
      setProducts(response)
    }
    
    // const getproductdetails = async (e) => {
    //   console.log("check :"+e.target.value);
    //   navigate('/item'+e.target.value)
    //   // const response = await getProductList()
    //   // if (response['status'] === 'success') {
    //   //   setProducts(response['data'])
    //   // } else {
    //   //   toast.error('Error while calling get /product api')
    //   // }
    // }
  
    return (
      <>
      <NavigationBarAdmin/>
      <div style={{position:"relative",minHeight:"100%" ,margin:"0"}}>
      <div className=''>
  
  <div id="carouselExampleIndicators" style={{height:"300px",paddingTop:"10px"}} className="carousel slide" data-ride="carousel">
    <ol className="carousel-indicators">
      {/* <li data-target="#carouselExampleIndicators" data-slide-to="" class="active"></li>
      <li data-target="#carouselExampleIndicators" data-slide-to=""></li>
      <li data-target="#carouselExampleIndicators" data-slide-to=""></li> */}
    </ol>
    <div className="carousel-inner">
      <div className="carousel-item active">
        <img className="d-block w-100" src="https://ik.imagekit.io/major/images/NewAd1.png?updatedAt=1693155358690" alt="First slide"></img>
      </div>
      <div className="carousel-item">
        <img className="d-block w-100" src="https://ik.imagekit.io/major/images/NewAd2.png?updatedAt=1693155358604" alt="Second slide"></img>
      </div>
      <div className="carousel-item">
        <img className="d-block w-100" src="https://ik.imagekit.io/major/images/NewAd3.png?updatedAt=1693155358598" alt="Third slide"></img>
      </div>
    </div>
    <a className="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
      <span className="carousel-control-prev-icon" aria-hidden="true"></span>
      <span className="sr-only">Previous</span>
    </a>
    <a className="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
      <span className="carousel-control-next-icon" aria-hidden="true"></span>
      <span className="sr-only">Next</span>
    </a>
  </div>
  
        <h1 style={{ textAlign: 'center', margin: 10 }}>Product Gallery</h1>
        <div className='row' style={{ marginTop: 50}}>
          {products.map((product) => {
            return (
              <div className='col-md-3'>
                <div className='card'>
               
                  <div className='card-body'>
                    <h5 className='card-title'>
                      <Link to={`/item/${product.id}`}>
                      <img  src={`http://localhost:8000/images/${product.productImage}`} alt="productimage" style={{ height: 200,width:220 }}/>
                        <div>{product['company']}</div>
                        <div>{product['productName']}</div>
                      </Link>
                     <h6>{product['category']}</h6> 
                      </h5>
                    <div className='card-text'>
                      {/* <div>{product['company']}</div>  */}
                       <div>â‚¹ {product['price']}</div>                   
                    </div>
                  </div>
                </div><br/>
              </div>
            )
           })} 
        </div>
        </div>
      </div>
      </>
    );
}


export default AdminDashboard

